import {Wrapper} from "./buttom.style";


const Button = ({text, callback, link}) => (

    <div>
        {link ? (
                <Wrapper type='button' onClick={callback}>
                    {text}
                </Wrapper>
            ) :
            (<Wrapper type='button' onClick={callback}>
                {text}
            </Wrapper>)}
    </div>

)


export default Button;
